import React, { Component } from 'react';
import { Route } from 'react-router-dom';
import * as eng from '../../providers/engine';

import AcademyHome from './home';
import AcademyIntro from './intro';

export default class Academy extends Component {

    render() {
        const route = eng.getStorageJson('route');
        const action = route.action?route.action:'';

        return (
            <React.Fragment>
                <Route exact path="/" component={AcademyHome} />
                <Route exact path="/intro" component={AcademyIntro} />
            </React.Fragment>
        )
    }

}
